import React from 'react';
import Button from '@material-ui/core/Button';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';
import { connectModal, InjectedProps  } from 'redux-modal';
import { ITodo } from '../../interfaces/ITodo';
import { ITask } from '../../interfaces/ITask';
import { Modal } from '@material-ui/core';

interface Props  {
    removeElement : ITodo | ITask;
    dialogContextText : string;
    dialogTitle : string;
    isTask : boolean;
    handlerRemove?(task : ITask) : void;
    handleRemoveTodo?(todo : ITodo) : void;
}
const body = (
    <div >
      <h2 id="simple-modal-title">Text in a modal</h2>
      <p id="simple-modal-description">
        Duis mollis, est non commodo luctus, nisi erat porttitor ligula.
      </p>
    </div>
  );
const FormDialog : React.FC<Props & InjectedProps>= ({removeElement, dialogContextText, dialogTitle, handlerRemove, handleRemoveTodo, isTask, ...props }: Props) => (
<Modal
  open={true}
  aria-labelledby="simple-modal-title"
  aria-describedby="simple-modal-description">
      {body}
</Modal>
);

export default connectModal({
    name : 'deleteRequest'
})(FormDialog);
